import { Outlet, Link } from "react-router-dom";

function Dashboard() {
  var students;
  fetch('https://localhost:3001/api/students', {method: 'GET', headers: {'Content-Type': 'application/json'}}).then(res => res.json()).then(data => students = data);
  return (
    <div id="dashboard-root">
      <table>
        <thead>
          <tr>Reg No.</tr>
          <tr>Name</tr>
          <tr>Joining</tr>
          <tr>gpa</tr>
          <tr>Section</tr>
        </thead>
        <tbody>
          {students.map((student) => {"<tr>" + student.regNo + "</tr><tr>" + student.fname + " " + student.lname + "</tr><tr>" + student.joinDate + "</tr><tr>" + student.gpa + "</tr><tr>" + student.section + "</tr>"})}
        </tbody>
      </table>
    </div>
  )}
export default Dashboard
